import { IndexHtml } from "../../login/components/IndexHtml.component";
import { RouterLogin } from "../../login/routes/routerLogin";

export const RouterNavigate = () => {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<IndexHtml />}></Route>
      </Routes>
    </BrowserRouter>
  );
};
